import { Router, Routes } from "react-router-dom";
import "./App.css";
import Navbar from "./components/Navbar";
import Home from "./pages/home";
import { RecipesProvider } from "./services/Context";


function App() {
  return (
     <RecipesProvider>
       <Router>

      <div className="App">
      <Routes>

        <Navbar />
        <Home />
      </Routes>
      </div>
       </Router>
     </RecipesProvider>


  );
}

export default App;
